import { useEffect, useState } from "react";
import { getClients } from "./util/getClientes";
import * as React from "react";
import { styled } from "@mui/material/styles";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell, { tableCellClasses } from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import Paper from "@mui/material/Paper";
import Button from "@mui/material/Button";
import DeleteIcon from "@mui/icons-material/Delete";
import Modal from "@mui/material/Modal";
import Box from "@mui/material/Box";
import Input from "@mui/material/Input";
import InputLabel from "@mui/material/InputLabel";
import FormControl from "@mui/material/FormControl";
import InputAdornment from "@mui/material/InputAdornment";
import AccountCircle from "@mui/icons-material/AccountCircle";
import DocumentScannerIcon from "@mui/icons-material/DocumentScanner";

function Clientes({ setClients, clients }) {
  useEffect(() => {
    getClients(setClients);
  }, []);

  function deleteClient(id) {
    fetch(`https://facec-webapi-2022.herokuapp.com/clientes/${id}`, {
      cache: "no-cache",
      method: "DELETE",
      mode: "cors",
    })
      .then(function (res) {
        console.log(res);
        return res.json();
      })
      .then((data) => {
        console.log(data);
        // setClients(data);
      })
      .catch((err) => console.log(err));
  }
  const StyledTableCell = styled(TableCell)(({ theme }) => ({
    [`&.${tableCellClasses.head}`]: {
      backgroundColor: theme.palette.common.black,
      color: theme.palette.common.white,
    },
    [`&.${tableCellClasses.body}`]: {
      fontSize: 14,
    },
  }));

  const StyledTableRow = styled(TableRow)(({ theme }) => ({
    "&:nth-of-type(odd)": {
      backgroundColor: theme.palette.action.hover,
    },
    // hide last border
    "&:last-child td, &:last-child th": {
      border: 0,
    },
  }));
  const style = {
    position: "absolute",
    top: "50%",
    left: "50%",
    transform: "translate(-50%, -50%)",
    width: 400,
    bgcolor: "background.paper",
    border: "2px solid #000",
    boxShadow: 24,
    p: 4,
  };

  const [open, setOpen] = React.useState(false);
  const handleOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);

  const [name, setName] = useState("");
  const [cpf, setCpf] = useState("");
  const [sex, setSex] = useState(0);

  async function saveClient() {
    let headers = new Headers();
    headers.append("Content-Type", "application/json");
    console.log(headers);

    const res = await fetch(
      "https://facec-webapi-2022.herokuapp.com/clientes",
      {
        headers,
        cache: "no-cache",
        method: "POST",
        mode: "cors",
        body: JSON.stringify({ nome: name, documento: cpf, sexo: sex }),
      }
    )
      .then(function (response) {
        if (response.ok) {
          return response.json();
        }
        return Promise.reject(response);
      })
      .then(function (data) {
        getClients(setClients);
      })
      .catch(function (error) {
        console.warn("Something went wrong.", error);
      });
    console.log(res);
  }

  return (
    <div className="text-xl text-zinc-100 border border-zinc-700 bg-gradient-to-r from-zinc-800 to-zinc-900 bg-opacity-40 h-full w-full rounded-xl p-6 mx-h-[1024px] overflow-auto scrollbar-thin scrollbar-track-zinc-700">
      <div className="table">
        <Button onClick={handleOpen}>Cadastrar novo cliente</Button>
        <TableContainer component={Paper}>
          <Table sx={{ minWidth: 700 }} aria-label="customized table">
            <TableHead>
              <TableRow>
                <StyledTableCell>Numero</StyledTableCell>
                <StyledTableCell>Nome</StyledTableCell>
                <StyledTableCell>Documento</StyledTableCell>
                <StyledTableCell>Delete</StyledTableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {clients &&
                clients.map((client, i) => {
                  return (
                    <StyledTableRow key={i}>
                      <StyledTableCell>{i + 1}</StyledTableCell>
                      <StyledTableCell>{client.nome}</StyledTableCell>
                      <StyledTableCell>{client.documento} </StyledTableCell>
                      <StyledTableCell>
                        <Button
                          variant="outlined"
                          onClick={() => deleteClient(client.id)}
                          startIcon={<DeleteIcon />}
                        >
                          Delete
                        </Button>
                      </StyledTableCell>
                    </StyledTableRow>
                  );
                })}
            </TableBody>
          </Table>
        </TableContainer>
        <Modal
          open={open}
          onClose={handleClose}
          aria-labelledby="modal-modal-title"
          aria-describedby="modal-modal-description"
        >
          <Box sx={style}>
            <FormControl variant="standard">
              <InputLabel htmlFor="input-with-icon-adornment">Nome</InputLabel>
              <Input
                onChange={(e) => setName(e.target.value)}
                id="input-with-icon-adornment"
                startAdornment={
                  <InputAdornment position="start">
                    <AccountCircle />
                  </InputAdornment>
                }
              />
              <InputLabel htmlFor="input-with-icon-adornment">CPF</InputLabel>
              <Input
                onChange={(e) => setCpf(e.target.value)}
                id="input-with-icon-adornment"
                startAdornment={
                  <InputAdornment position="start">
                    <AccountCircle />
                  </InputAdornment>
                }
              />
              <button
                onClick={saveClient}
                disabled={name.length == 0 || cpf.length == 0}
                type="submit"
                className="disabled:opacity-50 bg-primary-500 text-zinc-100 hover:bg-primary-300 focus:ring-2 focus:ring-offset-2 focus:ring-offset-zinc-800 focus:ring-primary-500 outline-none transition-colors ease-linear py-2 px-4 rounded-md mt-6"
              >
                Save
              </button>
            </FormControl>
          </Box>
        </Modal>
      </div>
    </div>
  );
}
export default Clientes;
